#       model.path=<path to checkpoint, prepared by make_checkpoint.py> \
#       indir=<path to input data> \
#       outdir=<where to store predicts>

import os
import sys
import base64

from saicinpainting.evaluation.utils import move_to_device
from saicinpainting.evaluation.refinement import refine_predict
# os.environ['OMP_NUM_THREADS'] = '1'
# os.environ['OPENBLAS_NUM_THREADS'] = '1'
# os.environ['MKL_NUM_THREADS'] = '1'
# os.environ['VECLIB_MAXIMUM_THREADS'] = '1'
# os.environ['NUMEXPR_NUM_THREADS'] = '1'
os.environ['Torch_HOME'] = 'E:\\Shaoyan\\thesis\\lama\\test-model'
import cv2
import numpy as np
import torch
import yaml
from omegaconf import OmegaConf
from torch.utils.data._utils.collate import default_collate

from saicinpainting.training.data.datasets import make_default_val_dataset
from saicinpainting.training.trainers import load_checkpoint
from saicinpainting.utils import register_debug_signal_handlers


if __name__ == '__main__':
    b64_image = ""

    b64_mask = ""

    b64_bytes = base64.b64encode(b64_mask.encode('utf-8'))
    mask_decoded_string = base64.b64decode(b64_bytes)

    b64_bytes = base64.b64encode(b64_image.encode('utf-8'))
    image_decoded_string = base64.b64decode(b64_bytes)

    predict_config = OmegaConf.load('default.yaml')

    device = torch.device(predict_config.device)

    train_config_path = os.path.join(predict_config.model.path, 'config.yaml')
    with open(train_config_path, 'r') as f:
        train_config = OmegaConf.create(yaml.safe_load(f))
    
    train_config.training_model.predict_only = True
    train_config.visualizer.kind = 'noop'

    checkpoint_path = os.path.join(predict_config.model.path, 
                                    'models', 
                                    predict_config.model.checkpoint)
    model = load_checkpoint(train_config, checkpoint_path, strict=False, map_location='cpu')
    model.freeze()
    model.eval()
    if not predict_config.get('refine', False):
            model.to(device)
    dataset = make_default_val_dataset(predict_config.indir, b64_image=b64_image, b64_mask=b64_mask,    **predict_config.dataset)
    batch = default_collate([dataset[0]])
    batch = move_to_device(batch, device)
    batch['mask'] = (batch['mask'] > 0) * 1
    # x = torch.randn(3, 224, 224, requires_grad=True)
    input = batch
    # input_tensors = {k: v for k, v in batch.items()}
    refined_batch = torch.cat((batch['image'], batch['mask']), 1)
    batch_out = model(input)   
    print('successfully predicted model')
    torch.onnx.export(model,                    # model being run
                          torch.randn(1, 4, 768, 960),               # model input (or a tuple for multiple inputs)
                          f="converted_model.onnx",   # where to save the model (can be a file or file-like object)
                          export_params=True,        # store the trained parameter weights inside the model file
                          opset_version=13,          # the ONNX version to export the model to
                          do_constant_folding=True,  # whether to execute constant folding for optimization
                          input_names=['input'],   # the model's input names
                          output_names=['output'],   # the model's output names
                          dynamic_axes={'input': {0: 'batch_size'},    # variable length axes
                                        'output': {0: 'batch_size'}},
                                        verbose=True)                 
    print('successfully converted model')             